import React from "react";
import { useEffect } from "react";
export default function Refecto({ data }) {
  const recur = (data) => {
    for (let key in data) {
      return {
        key: typeof data[key] === "object" ? recur(data[key]) : data[key],
      };
    }
  };

  useEffect(() => {
    recur(data);
  }, [data]);

  return (
    <div className="code-block">
      <pre>{JSON.stringify(data)}</pre>
    </div>
  );
}
